import React from 'react';
import '../Components/pages.css';
import Navbar from '../Components/Navbar.js';

const AboutUs =()=>{
    return(
        <>
      <Navbar/>
      <div>
        <h1 id="SFtitle"> Sample Flowers</h1>
        <h1 class="blahinfo">About Us</h1>
        </div>
        <div class="blahinfo">
        <h2>We are located in Southen California.
          We decided to pursue our vocation to become flower bouquet
          designers. We hope you like our designs. 
        </h2>
        <div>
       <img src="src/Components/whiteflowers.jpg" alt="whiteflowers"></img>
        </div>
        </div>
    </>
    );
};

export default AboutUs;
